tinymce.PluginManager.add("tiered-pricing-custom-mce-buttons",function(editor,url){void 0!==TPTAvailableCustomButtons&&Object.keys(TPTAvailableCustomButtons).forEach(function(buttonKey){editor.addButton(buttonKey,{text:TPTAvailableCustomButtons[buttonKey].name,tooltip:TPTAvailableCustomButtons[buttonKey].description,icon:!1,onclick:function(){editor.insertContent(TPTAvailableCustomButtons[buttonKey].variableKey)}})})});
